-- helper to get/create nested folder path under rootFolder
local function ensurePath(root, parts)
  local node = root
  for i=1, #parts-1 do
    local name = parts[i]
    local child = node:FindFirstChild(name)
    if not child then
      child = Instance.new('Folder')
      child.Name = name
      child.Parent = node
    end
    node = child
  end
  return node
end

