-- require entry
local initMod = rootFolder:FindFirstChild('init') or (rootFolder:FindFirstChild('init') or rootFolder:FindFirstChild('Init'))
if not initMod then
  warn('[Fluent singlefile] Root.init not found; attempting Components/Window fallback')
  local comp = rootFolder:FindFirstChild('Components')
  if comp then initMod = comp:FindFirstChild('Window') end
end
if not initMod then error('Fluent singlefile: cannot locate entry module (Root.init)') end

-- Return the library table from Root.init
local Fluent = require(initMod)
return Fluent